import React from "react";
import Header from "./Header";
import Footer from "./Footer";

const JoinEmployerPage = () => {
  const token = localStorage.getItem("token");
  return (
    <>
      <Header token={token} />
      <div>Employer!!</div>
      <Footer />
    </>
  );
};

export default JoinEmployerPage;
